import React from 'react';
import { Link } from "react-router-dom";

export default function NavBar() {
    return (
        <div>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Dashboard</Link>
                    </li>

                    <li>
                        <Link to="/contact">Contact</Link>
                    </li>   
                </ul>
            </nav>
        </div>
    );
}
